import * as React from "react";
import Autocomplete from "../Autocomplete";

interface CollectionSelectProps {
  onChange: (event: any, newValue: any, reason: any) => void;
  size?: "small" | "medium";
  filter?: (c: any) => boolean;
}
const CollectionSelect: React.FC<CollectionSelectProps> = ({
  onChange,
  size,
  filter = () => true,
}) => {
  return (
    <Autocomplete
      placeholder="Collection"
      onChange={onChange}
      options={collections.filter(filter).map((c: any) => {
        const metadata = JSON.parse(c.firstToken?.metadata || "{}");
        return {
          label: `${metadata.name?.replace(/[ ]*[#-]?1$/, "")} : ${
            c.contractId
          }`,
          value: c,
        };
      })}
    />
  );
};

